export const setDivVisibility = (isVisible) => ({
    type: 'SET_DIV_VISIBILITY',
    payload: isVisible,
  });

export const login = () => ({
    type: 'LOGIN',
    payload: authed
})

export const logout = () => ({
  type: 'LOGOUT',
  payload: authed
})
